import React from 'react';
import Logo from './logo.png';
import Iconimg from './test-img4.png';

const Navbar=()=> {

    return(
        <div>

            <nav className="navbar navbar-light bg-white">
                <a className="navbar-brand pl-5"><img src={Logo} width="140" alt="logo"/></a>
                <div class="img-icon d-flex"><img src={Iconimg} width="50" alt="logo"/>
                    <h6 class="px-2 pt-2">Angelina Deo</h6>
                  </div>
                  <small class="project-text">Project Manager?</small>
                    <form className="form-inline">
                        <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
                        <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
                    </form>
            </nav>

        </div>
    );
}



export default Navbar;
